import React from 'react';

function Skills() {
	return (
		<div className="skills-wrapper">
			<div className="skills-header">
				<h1>Skills</h1>
			</div>
			<div className="skill-icons">
				<h1>Skills Icons</h1>
			</div>
		</div>
	);
}

export default Skills;
